//STYLES
import styles from "./RightNavbar.module.scss";

//HOOKS
import React, { useState } from "react";
import { useContext } from "react";

//CONTEXT
import ReactFlagsSelect from "react-flags-select";
import NavContext from "../../Context/NavContext";
//ICONS , IMAGES
import { MdOutlineMenu } from "react-icons/md";

//Components
import MyProfile from "./Submenus/MyProfile";
import Support from "./Submenus/Support";
import Notifications from "./Submenus/Notifications";
import Search from "./Submenus/Search";

const RightNavbar = () => {
  const { nav, setNav } = useContext(NavContext);
  const [selected, setSelected] = useState("");
  const onSelect = (code: string): void => setSelected(code);

  const countries = array("Countries", ["US", "GB", "DE", "FR", "NG", "ES"]);
  const blacklistCountries = boolean("Blacklist Countries", false);

  return (
    <div className={styles.container}>
      {/* BURGER */}
      <div
        className={styles.burger_container}
        onClick={() => {
          setNav(!nav);
        }}
      >
        <MdOutlineMenu />
      </div>

      {/* ACTIONS */}
      <div className={styles.actions}>
        <div className="demo-wrapper">
          <ReactFlagsSelect
            selected={selected}
            onSelect={onSelect}
            countries={countries}
            blacklistCountries={blacklistCountries}
          />
        </div>
        <Search />
        <Notifications />
        {/* <Support /> */}
      </div>

      {/* My Profile */}
      <MyProfile />
    </div>
  );
};

export default RightNavbar;
